import { marked, Renderer } from "marked";

document.body.style = 'background: black;';

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      initialMarkdown: `
# Heading

## Subheading

This is a [link](https://example.com).

Inline code: \`console.log('Hello, world!')\`

\`\`\`
// Code block
function greet(name) {
  return "Hello, " + name + "!";
}
\`\`\`

