![Image](https://example.com/image.jpg)

**This text is bold.**

## Practical Examples

### Creating a Function

To create a function in JavaScript, you can use the following syntax:

\`\`\`javascript
function functionName(parameter1, parameter2) {
  // Function body
  // Do something with the parameters
  return result;
}
\`\`\`

### Styling Text

You can style text using various Markdown syntax:

- **Bold text**: Wrap the text with double asterisks (\*\*).
- *Italic text*: Wrap the text with single asterisks (\*).
- ~~Strikethrough text~~: Wrap the text with double tildes (\~\~).

### Creating a List

To create a list in Markdown, use hyphens (-) or asterisks (\*) followed by a space:

- List item 1
- List item 2

### Adding Links

To add a hyperlink, use the following syntax:

\[Link Text\](https://example.com)

Replace "Link Text" with the text you want to display and "https://example.com" with the actual URL.

### Inserting Images

To insert an image, use the following syntax:

\!\[Alt Text\](https://example.com/image.jpg)

Replace "Alt Text" with the alternative text for the image and "https://example.com/image.jpg" with the URL of the image.

These are just a few practical examples to demonstrate the usage of Markdown. You can explore more Markdown syntax and features to create richly formatted and informative content in your Markdown previewer.
`,
      markdown: "",
    };
  }

  componentDidMount() {
    this.resetMarkdown();
  }

  updateMarkdown(markdown) {
    this.setState({ markdown });
  }

  resetMarkdown() {
    this.setState({ markdown: this.state.initialMarkdown });
  }

  render() {
    const inputStyle = {
      width: "50%",
      height: "600px",
      padding: "1rem",
      color: "#A87D19",
      backgroundColor: "black",
      border: "none",
      borderStyle: "dotted",
      overflow: "auto",
      display: "flex",
    };

    const outputStyle = {
      width: "50%",
      height: "600px",
      padding: "1rem",
      backgroundColor: "black",
      borderStyle: "dotted",
      overflow: "auto",
    };

    const buttonStyle = {
      backgroundColor: "black",
      fontFamily: "'Courier Prime', monospace",
      color: "#A87D19",
      marginTop: "2rem",
    };

    const containerStyle = {
      backgroundColor: "black",
      fontFamily: "'Courier Prime', monospace",
      color: "#A87D19",
    };

    const headerStyle = {
      textAlign: "center",
      marginTop: "2rem",
    };

    const flexContainerStyle = {
      display: "flex",
      justifyContent: "center",
    };

    render() ;{
      const inputStyle = {
        width: "50%",
        height: "600px",
        padding: "1rem",
        color: "#A87D19",
        backgroundColor: "black",
        border: "none",
        borderStyle: "dotted",
        overflow: "auto",
      };

      const outputStyle = {
        width: "50%",
        height: "600px",
        padding: "1rem",
        backgroundColor: "black",
        borderStyle: "dotted",
        overflow: "auto",
      };

      const buttonStyle = {
        backgroundColor: "black",
        fontFamily: "'Courier Prime', monospace",
        color: "#A87D19",
        marginTop: "2rem",
      };

      const containerStyle = {
        backgroundColor: "black",
        fontFamily: "'Courier Prime', monospace",
        color: "#A87D19",
      };

      const headerStyle = {
        textAlign: "center",
        marginTop: "2rem",
      };

      return (
        <div style={containerStyle}>
          <div className="App">
            <div className="container">
              <div className="row mt-4">
                <div className="col text-center" style={headerStyle}>
                  <h1>Markdown Previewer</h1>
                  <button style={buttonStyle} onClick={this.resetMarkdown}>
                    Reset
                  </button>
                </div>
              </div>

              <div className="row mt-4">
                <div className="col-md-6 col-sm-12" style={{ paddingRight: "2rem" }}>
                  <div className="col text-center">
                    <h4>Markdown Input</h4>
                  </div>
                  <textarea
                    id="editor"
                    className="input"
                    style={inputStyle}
                    value={this.state.markdown}
                    onChange={(e) => {
                      this.updateMarkdown(e.target.value);
                    }}
                  />
                </div>

                <div className="col-md-6 col-sm-12">
                  <div className="col text-center">
                    <h4>Preview</h4>
                  </div>
                  <div
                    id="preview"
                    style={outputStyle}
                    dangerouslySetInnerHTML={{
                      __html: marked(this.state.markdown),
                    }}
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      );
    }
  }
}
